DROP DATABASE IF EXISTS capstone_ecommerce;
CREATE DATABASE capstone_ecommerce;
USE capstone_ecommerce;

DROP TABLE IF EXISTS data_transaction_ecommerce;
CREATE TABLE data_transaction_ecommerce (
  transaction_id INT AUTO_INCREMENT PRIMARY KEY,
  order_date DATE,
  customer_name VARCHAR(100),
  gender ENUM('Male','Female'),
  age INT,
  brand VARCHAR(100),
  product VARCHAR(200),
  category VARCHAR(50),
  quantity INT,
  unit_price DECIMAL(12,2),
  discount_percent INT,
  shipping_cost DECIMAL(10,2),
  total_amount DECIMAL(15,2),
  payment_method VARCHAR(50),
  sales_channel VARCHAR(50),
  customer_rating INT,
  city VARCHAR(100),
  province VARCHAR(100)
);

